import { Card , Row , Col } from "react-bootstrap"

function NewsItem(props) {
    return ( 
    <>
    <Row xs={1} md={2} className="g-4">
  {Array.from({ length: 4 }).map((_, idx) => (
    <Col>
      <Card>
        <Card.Img variant="top" src={props.pokemon.url} />
        <Card.Body>
          <Card.Text>
            {props.pokemon.name}
          </Card.Text>
        </Card.Body>
      </Card>
    </Col>
  ))}
</Row>
    </> );
}

export default PokemonCard;
